class TmnxLdpKeepAliveFactor(TextualConvention, Unsigned32):
    description = 'TmnxLdpKeepAliveFactor specifies the value by which the keepalive timeout should be divided to give the keepalive time i.e. the time interval, in seconds, between LDP Keepalive messages. LDP Keepalive messages are sent to keep the LDP session from timing out when no other LDP traffic is being sent between the neighbors.'
    status = 'current'
    subtypeSpec = Unsigned32.subtypeSpec + ValueRangeConstraint(1, 255)

class TmnxLdpKeepAliveTimeout(TextualConvention, Unsigned32):
    description = 'TmnxLdpKeepAliveTimeout specifies the the time interval, in seconds, that LDP waits before tearing down a session. If no LDP messages are exchanged during this time interval, the LDP session is torn down. Generally the keepalive timeout interval should be configured to be 3 times the keepalive time (the time interval between successive LDP Keepalive messages).'
    status = 'current'
    subtypeSpec = Unsigned32.subtypeSpec + ValueRangeConstraint(1, 65535)

class TmnxLdpHelloFactor(TextualConvention, Unsigned32):
    description = 'TmnxLdpHelloFactor specifies the value by which the hello timeout should be divided to give the hello time i.e. the time interval, in seconds, between LDP Hello messages. LDP uses Hello messages to discover neighbors and to detect loss of connectivity with its neighbors.'
    status = 'current'
    subtypeSpec = Unsigned32.subtypeSpec + ValueRangeConstraint(1, 255)

class TmnxLdpHelloTimeout(TextualConvention, Unsigned32):
    description = 'TmnxLdpHelloTimeout specifies the the time interval, in seconds, that LDP waits before declaring a neighbor to be down. Hello timeout is local to the system and is sent in the Hello messages to a neighbor. Hello timeout cannot be set to a value that is less than 3 times the hello time.'
    status = 'current'
    subtypeSpec = Unsigned32.subtypeSpec + ValueRangeConstraint(1, 65535)

class TmnxLdpBackoffTime(TextualConvention, Unsigned32):
    description = 'TmnxLdpBackoffTime specifies the backoff interval (initial and maximum). The backoff interval is the time, in seconds, that LDP waits after an LDP session setup has failed before it attempts to setup the session again. After the LDP session startup fails the first time, the backoff interval is set to an initial value. Thereafter, if session startup fails again the backoff interval increases exponentially until it reaches a maximum value specified by the maximum backoff interval. If the maximum backoff interval is set to zero (0), then the backoff interval does not increase exponentially after the first session startup attempt fails. Instead it remains constant and LDP will keep retrying to establish a session until it succeeds.'
    status = 'current'
    subtypeSpec = Unsigned32.subtypeSpec + ValueRangeConstraint(0, 2592000)

class TmnxLdpFECPolicy(TextualConvention, Integer32):
    description = "TmnxLdpFECPolicy determines whether the LSR should generate FECs and which FECs it should generate. system(1) - LDP will distribute label bindings only for the router's system IP address interface(2) - LDP will distribute label bindings for all LDP interfaces all(3) - LDP will distribute label bindings for all prefixes in the routing table none(4) - LDP will not distribute any label bindings."
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))
    namedValues = NamedValues(("system", 1), ("interface", 2), ("all", 3), ("none", 4))

class TmnxLdpLabelDistMethod(TextualConvention, Integer32):
    description = "TmnxLdpLabelDistMethod describes the label distribution method used. When the value is 'downstreamOnDemand', label bindings are distributed to the upstream LSR only when a label request message is received. When the value is 'downstreamUnsolicited', label bindings are distributed to the upstream LSR, for each FEC, without requiring a request message for the FEC from the upstream LSR."
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2))
    namedValues = NamedValues(("downstreamOnDemand", 1), ("downstreamUnsolicited", 2))

