class TmnxLabelStatus(TextualConvention, Bits):
    description = "TmnxLabelStatus bit flags specifies the status of an ingress or egress label. Flags marked dummy* are not used and MUST be 0. 'statusSignalingSupported' - indicates whether status signaling is enabled or not. 'inUsePush' - indicates that the label contains valid information that is currently being used as a 'push' label. 'inUseSwap' - indicates that the label contains valid information that is currently being used as a 'swap' label. 'inUsePop' - indicates that the label contains valid information that is currently being used as a 'pop' label. 'released' - indicates that the label is in the process of being freed. With this flag set, no other flags will be set. 'notInUse' - indicates that the label contains valid information but is currently not being used possibly because the service is temporarily down. 'withdrawn' - indicates that the label has not been sent (possibly due to a mismatch in control word or status signaling) 'controlWord' - indicates that the control word will be signaled"
    status = 'current'
    namedValues = NamedValues(("dummyB0", 0), ("dummyB1", 1), ("statusSignalingSupported", 2), ("inUsePush", 3), ("inUseSwap", 4), ("inUsePop", 5), ("released", 6), ("notInUse", 7), ("withdrawn", 8), ("controlWord", 9))

