    description = "TmnxLdpFECFlags bit flags define the characteristics of FEC. Flags marked dummy* are not used and MUST be 0. Flag 'egress': this node is an egress for this FEC. Flag 'ingress': this node is a potential ingress for this FEC. Flag 'installedSwap': the label for this FEC has been programmed as a 'swap' label. Flag 'installedPush': the label for this FEC has been programmed as a 'push' label. Flag 'installedPop': the label for this FEC has been programmed as a 'pop' label. Flag 'local': this FEC is local to this node. Flag 'nextHop': the nextHop for this FEC is known. Flag 'vcSwitching': vcSwitching is enabled for the FEC. Flag 'importTargPolicyRejected': targeted LDP import policy has rejected this FEC. Flag 'exportTargPolicyRejected': targeted LDP export policy has rejected this FEC."
    status = 'current'
    namedValues = NamedValues(("dummyB0", 0), ("egress", 1), ("ingress", 2), ("installedSwap", 3), ("installedPush", 4), ("installedPop", 5), ("local", 6), ("nextHop", 7), ("importPolicyRejected", 8), ("exportPolicyAccepted", 9), ("installedStaticFec", 10), ("vcSwitching", 11), ("importTargPolicyRejected", 12), ("exportTargPolicyRejected", 13))

