if mibBuilder.loadTexts: vRtrLdpGenTransportAddrType.setDescription("The value of vRtrLdpGenTransportAddrType specifies the source of the transport address to be used when setting up the LDP TCP sessions. The transport address can be configured globally (applied to all interfaces) or per interface. When the value of this object is 'interface', the interface's IP address is used to setup the LDP session between neighbors. If multiple interfaces exist between two neighbors, the 'interface' mode cannot be used since only one LDP session is actually set up between the two neighbors. When the value of this object is 'system', the system's IP address is used to set up the LDP session between neighbors. This value is only applicable to LDP interfaces and not for targeted sessions.")
vRtrLdpGenPropagatePolicy = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 1, 1, 16), TmnxLdpFECPolicy().clone('system')).setMaxAccess("readcreate")
