if mibBuilder.loadTexts: vRtrLdpGenPropagatePolicy.setDescription("The value of vRtrLdpGenPropagatePolicy determines whether the LSR should generate FECs and which FECs it should generate. When the value of this object is 'system', LDP will distribute label bindings only for the router's system IP address When the value of this object is 'interface', LDP will distribute label bindings for all LDP interfaces When the value of this object is 'all', LDP will distribute label bindings for all prefixes in the routing table When the value of this object is 'none', LDP will not distribute any label bindings. This value is only applicable to LDP interfaces and not for targeted sessions.")
vRtrLdpGenLoopDetectCapable = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 1, 1, 17), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5))).clone(namedValues=NamedValues(("none", 1), ("other", 2), ("hopCount", 3), ("pathVector", 4), ("hopCountAndPathVector", 5))).clone('none')).setMaxAccess("readcreate")
if mibBuilder.loadTexts: vRtrLdpGenLoopDetectCapable.setStatus('current')
if mibBuilder.loadTexts: vRtrLdpGenLoopDetectCapable.setDescription("The value of vRtrLdpGenLoopDetectCapable indicate whether this LSR supports loop detection and if so, what type of loop detection is supported. When the value is 'none' loop detection is not supported on this LSR. When the value is 'other' Loop Detection is supported but by a method other than those listed below. When the value is 'hopCount' Loop Detection is supported by Hop Count only. When the value is 'pathVector' Loop Detection is supported by Path Vector only. When the value is 'hopCountAndPathVector' Loop Detection is supported by both Hop Count and Path Vector. Since Loop Detection is determined during Session Initialization, an individual session may not be running with loop detection. This object simply gives an indication of whether or not the LSR has the ability to support Loop Detection and which types.")
vRtrLdpGenHopLimit = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 1, 1, 18), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 255)).clone(255)).setMaxAccess("readcreate")
