vRtrLdpGenPathVectorLimit = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 1, 1, 19), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 255)).clone(255)).setMaxAccess("readcreate")
