vRtrLdpGenBackoffTime = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 1, 1, 20), TmnxLdpBackoffTime().subtype(subtypeSpec=ValueRangeConstraint(1, 2592000)).clone(15)).setUnits('seconds').setMaxAccess("readcreate")
if mibBuilder.loadTexts: vRtrLdpGenBackoffTime.setStatus('current')
if mibBuilder.loadTexts: vRtrLdpGenBackoffTime.setDescription('The value of vRtrLdpGenBackoffTime specifies the initial value for the backoff interval. The backoff interval is the time, in seconds, that LDP waits after an LDP session setup has failed before it attempts to setup the session again. After the LDP session startup fails the first time, the backoff interval is set to the value of vRtrLdpGenBackoffTime. Thereafter, if session startup fails again the backoff interval increases exponentially.')
vRtrLdpGenMaxBackoffTime = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 1, 1, 21), TmnxLdpBackoffTime().clone(120)).setUnits('seconds').setMaxAccess("readcreate")
if mibBuilder.loadTexts: vRtrLdpGenMaxBackoffTime.setStatus('current')
if mibBuilder.loadTexts: vRtrLdpGenMaxBackoffTime.setDescription('The value of vRtrLdpGenMaxBackoffTime specifies the maximum value for the backoff interval. For each successive failure of the LDP session startup, the backoff interval (the time for which the router waits before retrying) increases exponentially. If the backoff interval exceeds vRtrLdpGenMaxBackoffTime, the router will give up trying to establish the LDP session. If vRtrLdpGenMaxBackoffTime is set to zero (0), then the backoff interval does not increase exponentially after the first session startup attempt fails. Instead it remains constant and LDP will keep retrying to establish a session until it succeeds.')
vRtrLdpGenTargKeepAliveFactor = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 1, 1, 22), TmnxLdpKeepAliveFactor().clone(4)).setMaxAccess("readcreate")
