vRtrLdpGenTargKeepAliveTimeout = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 1, 1, 23), TmnxLdpKeepAliveTimeout().clone(40)).setUnits('seconds').setMaxAccess("readcreate")
