if mibBuilder.loadTexts: vRtrLdpGenTargKeepAliveTimeout.setDescription('The value of vRtrLdpGenTargKeepAliveTimeout specifies the time interval, in seconds, that LDP waits before tearing down a session. If no LDP messages are exchanged during this time interval, the LDP session is torn down. Genly the value of vRtrLdpGenTargKeepAliveTimeout is configured to be 3 times the keepalive time (the time interval between successive LDP keepalive messages). This value is only applicable to targeted sessions and not to LDP interfaces.')
vRtrLdpGenTargHelloFactor = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 1, 1, 24), TmnxLdpHelloFactor().clone(3)).setMaxAccess("readcreate")
