vRtrLdpIfInheritance = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 5, 1, 7), Unsigned32()).setMaxAccess("readcreate")
if mibBuilder.loadTexts: vRtrLdpIfInheritance.setStatus('current')
if mibBuilder.loadTexts: vRtrLdpIfInheritance.setDescription("Some writable object in this row that can be configured to inherit its value from its corresponding object in the vRtrLdpGeneralTable for LDP interfaces or from the corresponding object in the vRtrLdpIfTable for targeted peers. vRtrLdpIfInheritance controls whether to inherit the operational value of that object, or use the administratively set value. This object is a bit-mask, with the following positions: vRtrLdpIfKeepAliveFactor 0x1 vRtrLdpIfKeepAliveTimeout 0x2 vRtrLdpIfHelloFactor 0x4 vRtrLdpIfHelloTimeout 0x8 vRtrLdpIfBackoffTime 0x10 vRtrLdpIfMaxBackoffTime 0x20 vRtrLdpIfTransportAddrType 0x40 vRtrLdpIfPassiveMode 0x80 When the bit for an object is set to one, then the object's administrative and operational value are whatever the DEFVAL or most recently SET value is. When the bit for an object is set to zero, then the object's administrative and operational value are inherited from the corresponding object in vRtrLdpGeneralTable for LDP interfaces or the vRtrLdpIfTable for targeted peers.")
vRtrLdpIfKeepAliveFactor = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 5, 1, 8), TmnxLdpKeepAliveFactor().clone(3)).setMaxAccess("readcreate")
if mibBuilder.loadTexts: vRtrLdpIfKeepAliveFactor.setStatus('current')
if mibBuilder.loadTexts: vRtrLdpIfKeepAliveFactor.setDescription('The value of vRtrLdpIfKeepAliveFactor specifies the value by which the keepalive timeout (vRtrLdpIfKeepAliveTimeout) should be divided to give the keepalive time i.e. the time interval, in seconds, between LDP keepalive messages. LDP keepalive messages are sent to keep the LDP session from timing out when no other LDP traffic is being sent between the neighbors.')
vRtrLdpIfKeepAliveTimeout = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 5, 1, 9), TmnxLdpKeepAliveTimeout().clone(30)).setUnits('seconds').setMaxAccess("readcreate")
if mibBuilder.loadTexts: vRtrLdpIfKeepAliveTimeout.setStatus('current')
if mibBuilder.loadTexts: vRtrLdpIfKeepAliveTimeout.setDescription('The value of vRtrLdpIfKeepAliveTimeout specifies the time interval, in seconds, that LDP waits before tearing down a session. If no LDP messages are exchanged during this time interval, the LDP session is torn down. Generally the value of vRtrLdpIfKeepAliveTimeout is configured to be 3 times the keepalive time (the time interval between successive LDP keepalive messages).')
vRtrLdpIfHelloFactor = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 5, 1, 10), TmnxLdpHelloFactor().clone(3)).setUnits('seconds').setMaxAccess("readcreate")
if mibBuilder.loadTexts: vRtrLdpIfHelloFactor.setStatus('current')
if mibBuilder.loadTexts: vRtrLdpIfHelloFactor.setDescription('The value of vRtrLdpIfHelloFactor specifies the value by which the hello timeout (vRtrLdpIfHelloTimeout) should be divided to give the hello time i.e. the time interval, in seconds, between LDP Hello messages. LDP uses hello messages to discover neighbors and to detect loss of connectivity with its neighbors.')
vRtrLdpIfHelloTimeout = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 5, 1, 11), TmnxLdpHelloTimeout().clone(15)).setUnits('seconds').setMaxAccess("readcreate")
if mibBuilder.loadTexts: vRtrLdpIfHelloTimeout.setStatus('current')
if mibBuilder.loadTexts: vRtrLdpIfHelloTimeout.setDescription('The value of vRtrLdpIfHelloTimeout specifies the hello time also known as hold time. It is the time interval, in seconds, that LDP waits before declaring a neighbor to be down. Hello timeout is local to the system and is sent in the hello messages to a neighbor. Hello timeout cannot be set to a value that is less than 3 times the hello time.')
vRtrLdpIfBackoffTime = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 5, 1, 12), TmnxLdpBackoffTime().subtype(subtypeSpec=ValueRangeConstraint(1, 2592000)).clone(15)).setUnits('seconds').setMaxAccess("readcreate")
if mibBuilder.loadTexts: vRtrLdpIfBackoffTime.setStatus('current')
if mibBuilder.loadTexts: vRtrLdpIfBackoffTime.setDescription('The value of vRtrLdpIfBackoffTime specifies the initial value for the backoff interval. The backoff interval is the time, in seconds, that LDP waits after an LDP session setup has failed before it attempts to setup the session again. After the LDP session startup fails the first time, the backoff interval is set to the value of vRtrLdpIfBackoffTime. Thereafter, if session startup fails again the backoff interval increases exponentially.')
vRtrLdpIfMaxBackoffTime = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 5, 1, 13), TmnxLdpBackoffTime().clone(120)).setUnits('seconds').setMaxAccess("readcreate")
if mibBuilder.loadTexts: vRtrLdpIfMaxBackoffTime.setStatus('current')
if mibBuilder.loadTexts: vRtrLdpIfMaxBackoffTime.setDescription('The value of vRtrLdpIfMaxBackoffTime specifies the maximum value for the backoff interval. For each successive failure of the LDP session startup, the backoff interval (the time for which the router waits before retrying) increases exponentially. If the backoff interval exceeds vRtrLdpIfMaxBackoffTime, the router will give up trying to establish the LDP session. If vRtrLdpIfMaxBackoffTime is set to zero (0), then the backoff interval does not increase exponentially after the first session startup attempt fails. Instead it remains constant and LDP will keep retrying to establish a session until it succeeds.')
vRtrLdpIfTransportAddrType = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 8, 5, 1, 14), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("interface", 1), ("system", 2))).clone('system')).setMaxAccess("readcreate")
